import './ExpenseItem.css'
import ExpenseDate from './ExpenseDate'


function ExpenseData(props) {
    const exps = props.map((data)=>{
        <div className="expenses">
            <ExpenseDate date={data.date} />
            <div>{data.title}</div>
            <div>{data.amount}</div>
        </div>
    });
    return (
        <div>{exps}</div>
    );
}

export default ExpenseData;
